import React from 'react';
import ReactDOM from 'react-dom';

function Card(){
    return(
      <>
        <div className="cards">
            <div className="card">
                <img src="https://wallpapercave.com/wp/wp4056410.jpg" alt="myPic" className="card_img" />
                <div className="card_info">
                    <span className="card_category">A Netflix Original Series</span>
                    <h3 className="card_title"> </h3>
                    <a href="https://www.netflix.com/in/title/80100172" target="_blank">
                    <button>Watch Now</button>
                    </a>
                </div>
            </div>
        </div>
     </>
    );
}

ReactDOM.render(
   <>
    <Card/>
   </>,
   document.getElementById('root')
);
